import React from 'react'
import List from './List'
import Search from './Search'

const People = [{name: "Carl"}, {name: "Adam"}, {name: "Jeffery"}, {name: "Donny"}, {name: "Freddy"}];

export default function App() {
    return (
        <div>
            <Search/>
            <List listObject={People}/>
        </div>
    )
}
